import './App.css';
import Button from 'react-bootstrap/Button';
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <h1>KickBuddy</h1>
      <div class="container">
        <div class="play"><Button>PLAY</Button></div>
        <div class="settings"><Button>SETTINGS</Button></div>
        <div class="login"><Button>PLAY</Button></div>
        <div class="profile"><Button>PLAY</Button></div>
      </div>      
    </div>
  );
}

export default App;
